import React from "react"

import PrivateRoute from "../tools/PrivateRoute"

import history from "../tools/history"

import { Switch, Route, Router } from "react-router-dom";

import {Initial,DashBoard,AutorizePage,} from "../Pages"

const Routes = () =>{
    return(
        <Router history={history}>
            <Switch>
                <Route exact path="/" component={Initial}></Route>
                <Route path="/autorize" component={AutorizePage}></Route>
                <PrivateRoute path="/dashboard" component={DashBoard}></PrivateRoute>
                <PrivateRoute path="/dashboard/playlists" component={Initial}></PrivateRoute>
                <PrivateRoute path="/dashboard/account" component={Initial}></PrivateRoute>
                <PrivateRoute path="/dashboard/search" component={Initial}></PrivateRoute>


                
            </Switch>
        </Router>
    )
}

export default Routes;
